import React, {useState} from 'react';
import './App.css';

function App() {
  let [counter, changeCounter] = useState(0)
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Reps: {counter}
        </p>
        <button onClick={() => {changeCounter(counter + 1)}}>
          Complete Rep
          </button>
        <button onClick={() => {changeCounter(counter = 0)}}>
          Reset
        </button>
      </header>
    </div>
  );
}

export default App;
